import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function App()  {


    return (
     <SafeAreaView style={styles.container}>
      <View style={styles.v}>
        </View>
      </SafeAreaView>
    );

}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
